import React from "react";
import Friend from "./friend";
import Member from "./member";

function FriendsList() {
  return (
    <div class="friends-list">
      <div class="box-border">
        <h4 class="mx-2 my-2"> Friends: </h4>
        <Friend
          userName={"avanboven"}
          link={
            "https://www.shutterstock.com/image-photo/pure-youth-crazy-english-cocker-spaniel-1424153078"
          }
        />
        <Friend userName={"bbridge"} link={"http://placehold.it/10x10"} />
        <Friend userName={"ddolan"} link={"http://placehold.it/10x10"} />
        <Friend userName={"cmonaghan"} link={"http://placehold.it/10x10"} />
        <hr />
        <h4 class="mx-2 my-2"> Members: </h4>
        <Member userName={"ahuffman"} link={"http://placehold.it/10x10"} />
        <Member userName={"dneal"} link={"http://placehold.it/10x10"} />
        <Member userName={"slanglois"} link={"http://placehold.it/10x10"} />
        <Member userName={"mgamble"} link={"http://placehold.it/10x10"} />
        <Member userName={"rcurfman"} link={"http://placehold.it/10x10"} />
        <Member userName={"mhoffman"} link={"http://placehold.it/10x10"} />
      </div>
    </div>
  );
}

export default FriendsList;
